import React,{useState} from 'react';
import {Button,Modal} from 'react-bootstrap'

const Modals = () => {
  const [show, setShow] = useState(true);
  return <div>
       <Button className='invisible'  variant="primary" onClick={() => setShow(true)}>
            Custom Width Modal
        </Button>
       <Modal  show={show}  >
                <Modal.Body >
               
                  <img className="img-fluid" src='data:image/jpeg;base64,'/> 
                </Modal.Body>
                <Modal.Footer> <button type="button" className="btn btn-secondary" show={show} onClick={() => setShow(false)}>Close</button></Modal.Footer>
            </Modal>
  </div>
};

export default Modals;
